        "detail": ["BLOOD CONNECT is completely free to use android application for finding blood donors and donating blood, finding nearby ambulances and getting blood bank updates in real time.", "We use real time location and recommend potential blood donors in 35 Km radius in case if any patients of matching blood group need blood. Filtering based on gender, age and weight category is done to optimize the type of blood required for the patients. We are currently serving in 5 districts of Nepal with 35 active volunteers. Nepal Red cross society Sunsari district caper is our official partner with Memorandum of Understanding (MoU) signed in 23rd march 2022."],
