        "type": "paragraph",
        "detail": ["MCQ tests in blockchain can be a gamechanger compared to how it is performed today. But there are problems with random question selection for each test session, as we cannot generate random numbers on Ethereum smart contracts.", "This project tries to solve the problem by taking the hash of question and time of addition of each question to retrieve questions for each session.", "The solution has lots of holes and can be broken in lots of ways. Still, it is an example of how MCQ can be performed on blockchain.", "There is a smart contract where questions can be added and a flutter app interface can be used to access questions and take tests."],
