        "image": "",
        "type": "paragraph",
        "detail": ["Large national monopolies like Nepal Electricity Athority has always been accused of power mismanagement and the translucent nature of these structures does not help the global energy crisis.", "Accusations of intermediate and illicit power sales in distribution network is out there which can harm consumers in different ways.", "Also country like Nepal, rich in water resources can have a power economy of almost 20 billion dollars and this big chunk of national economy to a unit organisation.", "We believe that, if large structures are broken down of primitive ways and regulated using smart contracts, we can get make the entire energy network more efficient and fraud proof. This can also enable small energy players to act in the network and literally save power."],
